import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';

function Work(props) {
    return (
        <div>
            <div className="work-section">
            <Container>
                <Row>
                    <Col>
                        <h1>Work</h1>
                    </Col>
                    <Col md={12}>
                        <div class="skills-container">
                        </div>
                    </Col>
                </Row>
            </Container>
        </div>
        </div>
    );
}

export default Work;
